choices.text:
DocumentBuilder docBuilder = docBuilderFactory.newDocumentBuilder();


parser = docBuilder.getDOMImplementation().createLSParser(DOMImplementationLS.MODE_SYNCHRONOUS, null);
parser.getDomConfig().setParameter("namespaces", Boolean.TRUE);
parser.getDomConfig().setParameter("error-handler", this);


if (source instanceof InputSource) {
    parser.getDomConfig().setParameter("schema-type", "http://www.w3.org/2001/XMLSchema");
    parser.getDomConfig().setParameter("schema-location", source);
} else if (source instanceof InputStream) {
    parser.getDomConfig().setParameter("schema-type", "http://www.w3.org/2001/XMLSchema");
    parser.getDomConfig().setParameter("schema-location", "quartz_jobs.xsd");
} else if (source instanceof File) {
    parser.getDomConfig().setParameter("schema-type", "http://www.w3.org/2001/XMLSchema");
    parser.getDomConfig().setParameter("schema-location", "quartz_jobs.xsd");
}

